      <Container fluid className='star bg-black' >

        <Row>
        <Col xs= {1}><SideBar/></Col>
          <Col xs lg="12" className="text-center">


            <svg width='80vw' height='100vh' viewBox="40 0 900 500" className="d-block m-auto">

              <Marks
                data={data}
              />

            </svg>

          </Col>

        </Row>


